          friendScore="300"
          time="4"
        />
        <FriendCard
          avatar="Nia"
          name="Christie Molloy"
          friendScore="300"
          time="4"
        />
        <FriendCard
          avatar="Felipe"
          name="Christie Molloy"
          friendScore="300"
          time="4"
        />
        <FriendCard
          avatar="Sasha"
